import Link from "next/link";

const Index = () => (
  <div>
    <ul>
      <li>
        <Link href="/about">
          <a>Home</a>
        </Link>
      </li>
    </ul>
    <h1>Welcome to Bitzprice</h1>
  </div>
);

export default Index;
